import React from 'react';
import 'tachyons/css/tachyons.css';

const Card = ({email, id, name})=>{
    
        return(
            <div className="bg-light-green dib br3 pa3 mr3 grow bw-4 shadow-5 tc">
                <img src={`https://robohash.org/${id}?size=200x200`}></img>
                <h3>Name: {name} </h3>
                <p>email: {email} </p>
            </div>
        );
    
}

export default Card;
